import { Buton } from "./Buton";

export const Modal = () => {
  return (
    <div className="modalWrapper">
      <h2>Are you sure ?</h2>
      <div>
        <Buton>Yes</Buton>
        <Buton>No</Buton>
      </div>
    </div>
  );
};
